import React from "react";

const WarningModal = ({ message, setState, method }) => {
  const styles = {
    container: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      alignSelf: "center",
      height: 300,
      width: 300,
    },
  };
  return (
    <>
      <div style={styles.container}>
        <h2>{message}</h2>
        <button
          onClick={() => setState(false)}
          className="btn btn-outline-info"
        >
          No
        </button>

        <button
          onClick={() => {
            method();
            setState(false);
          }}
          className="btn btn-outline-danger"
        >
          Yes
        </button>
      </div>
    </>
  );
};

export default WarningModal;
